dbg=false
function debug()
	if keyp(4) then
  if not dbg then dbg=true
  else dbg=false end
 end
 if dbg then
 	print("playerX: "..p.x.."",8,16,12)
  print("playerY: "..p.y.."",8,24,12)
  print("area: "..area.."",8,32,12)
  print("cameraX: "..c.x.."",8,40,12)
  print("cameraY: "..c.y.."",8,48,12)
  print("camLimL: "..c.ll.."",8,56,12)
  print("camLimR: "..c.lr.."",8,64,12)
  print("camLimU: "..c.lu.."",8,72,12)
  print("camLimD: "..c.ld.."",8,80,12)
  print(isSave,8,88,12)
 	print("pmem0(pX): "..pmem(0).."",8,96,12)
  print("pmem1(pY): "..pmem(1).."",8,104,12)
  print("pmem2(hl): "..pmem(2).."",8,112,12)
  print("pmem3(wp): "..pmem(3).."",8,120,12)
  print("pmem4(ab): "..pmem(4).."",8,128,12)
  --
  print("slash: "..#slh.."",96,16,12)
  print("arrow: "..#arw.."",96,24,12)
  print("effUp: "..#eup.."",96,32,12)
 end
end

function TIC()
	render()debug()
end

--save & load
function save()
	sv.px=floor(p.x) sv.py=floor(p.y)
	sv.hl=p.hl
	sv.wp=p.wp sv.bw=bw.am sv.ab=p.ab
 pmem(0,sv.px)pmem(1,sv.py)
 pmem(2,sv.hl)
 pmem(3,sv.wp)pmem(5,sv.bw)pmem(4,sv.ab)
	isSave=true
end
function load()
	p.x=pmem(0)p.y=pmem(1)
	p.hl=pmem(2)
	p.wp=pmem(3)bw.am=pmem(5)p.ab=pmem(4)
end
------------

function render()
	--title
	if scn==0 then
		sTitle()
	--game
	elseif scn==1 then
		sGame()
	end
end

function sTitle()
	map(210,102)
	spr(240,56,40,0,2,0,0,8,1)
	print("Game by MFauzan",92,60,8,false,1,true)
	if not zClick then
		if time()%1000>500 then
		 print("PRESS     TO START",74,98,14)
		 print("PRESS     TO START",74,97,12)
		 spr(188,109,96)
		end
		if btnp(4) then zClick=true end
	else
		local coC=14--continue color
		if pmem(0)>0 then coC=12 end
		spr(184,84,87)print("TO CONTINUE",96,88,coC)
		spr(185,84,103)print("TO NEW GAME",96,104,12)
		--continue
		if pmem(0)>0 and btnp(0) then
			load()
			scn=1
		end
		--new game
		if btnp(1) then
			p.x=56 p.y=112
			scn=1
		end
	end
end

--init=false
--function sInit()
--end
function sGame()
	--if not init then sInit()init=true end
	--change area
	if p.x>0 and p.x<1680 and ((p.y>0 and p.y<816) or (p.y>952 and p.y<1088)) then
		c.ll=0 c.lr=-1440 c.lu=(p.y//136)*-136 c.ld=c.lu
	elseif p.x>0 and p.x<1440 and p.y>816 and p.y<952 then
		c.ll=0 c.lr=-1200 c.lu=-816 c.ld=c.lu
	elseif (p.x>1440 and p.x<1680 and p.y>816 and p.y<952) or (p.x>1680 and p.x<1920 and p.y>952 and p.y<1088) then
		c.ll=(p.x//240)*-240 c.lr=c.ll c.lu=(p.y//136)*-136 c.ld=c.lu
	elseif p.x>1680 and p.x<1920 and p.y>0 and p.y<816 then
		c.ll=-1680 c.lr=c.ll c.lu=0 c.ld=-680
	end
	--camera
	c.x=112-p.x c.y=68-p.y
	if c.x>c.ll then c.x=c.ll end
	if c.x<c.lr then c.x=c.lr end
	if c.y>c.lu then c.y=c.lu end
	if c.y<c.ld then c.y=c.ld end
	map(0,0,240,136,c.x,c.y)
	--object
	hud()player()
	drawSlash()
	drawArrow()
	drawEffUp()
	if p.wp==0 then getSword(32,240) end
	if bw.am==0 then  getBow(1708,160) end
end

function solid(x,y)
 return mget(x//8,y//8)<80
end
function saveArea(x,y)
 return mget(x//8,y//8)==160 or mget(x//8,y//8)==161
end
function healArea(x,y)
 return mget(x//8,y//8)==162 or mget(x//8,y//8)==163
end
function shroom(x,y)
 return mget(x//8,y//8)==77 or mget(x//8,y//8)==78 or mget(x//8,y//8)==79
end

function hud()
	h=p.hl*8
	--bg
	rect(0,0,240,14,0)
	--health
 for x=8,24,8 do spr(177,x,2,0) end
 for x=8,h,8 do spr(176,x,2,0) end
 --weapon
 spr(178,160,2,0)
 spr(179,176,2,0)
 if p.wp==0 then
 	spr(183,168,2,0)--?
 elseif p.wp==1 then
 	spr(189,152,2,0)--button
  spr(180,168,2,0)--sword
 elseif p.wp==2 then
 	spr(189,152,2,0)--button
  spr(181,168,2,0)--bow & arrow
 else
 end
 --power
 spr(178,208,2,0)
 spr(179,224,2,0)
 if p.ab>0 then
 	spr(190,200,2,0)--button
 	spr(182,216,2,0)--power up
 else spr(183,216,2,0)
 end
 --save
 if saveArea(p.x+4,p.y+4) then
 	spr(164,48,2,0)
  if not isSave then effUp(12)save()isSave=true end
 else isSave=false end
 --frame
 rectb(0,14,240,122,1)
end

--weapon
function getSword(x,y)
	spr(180,x+c.x,y+c.y,0)
	if p.x+4>x and p.x+4<x+8 and p.y+4>y and p.y+4<y+8 then
		effUp(4)p.wp=1
	end
end
function sword(x,y,f)
	if f==1 then sw.x=-3
	else sw.x=3 end
	if sw.ac then
		sw.t=0
		spr(192,x+sw.x+c.x,y-2+c.y,0,1,f)
	else
		sw.t=sw.t+1
		if sw.t>20 then sw.ac=true end
	end
	--attack
	if btnp(5) then
		sw.ac=false
		slash(x+sw.x*3,y,f)
	end
end
function slash(mx,my,mf)
 local s={x=mx,y=my,f=mf,t=0}
 slh[#slh+1]=s
end
function drawSlash()
	for i,s in pairs(slh) do
		s.t=s.t+1
		spr(200+t.an%20//5,s.x+c.x,s.y+c.y,0,1,s.f)
		if s.t==20 then table.remove(slh,i) end
	end
end

function getBow(x,y)
	spr(181,x+c.x,y+c.y,0)
	if p.x+4>x and p.x+4<x+8 and p.y+4>y and p.y+4<y+8 then
		effUp(4)bw.am=1
	end
end
function bow(x,y,f)
	if f==1 then bw.x=-3
	else bw.x=3 end
	if bw.ac then bw.t=0 bw.sp=193
	else bw.t=bw.t+1 if bw.t>15 then bw.ac=true end
	end
	spr(bw.sp,x+bw.x+c.x,y-1+c.y,0,1,f)
	--attack
	if btnp(5) and bw.ac then
		arrow(x+bw.x,y+2,bw.x)
		bw.sp=194 bw.ac=false
	end
end
function arrow(mx,my,mvx)
 local ar={x=mx,y=my,vx=mvx,t=0}
 arw[#arw+1]=ar
end
function drawArrow()
	for i,ar in pairs(arw) do
		ar.t=ar.t+1
		ar.x=ar.x+ar.vx
		pix(ar.x+c.x,ar.y+c.y,12)
		if ar.t==20 then table.remove(arw,i) end
	end
end
-----

function player()
	t.an=t.an+1
 --movement
 if btn(2) then p.an=t.an%28//7 p.f=1 p.vx=-p.sp
 elseif btn(3) then p.an=t.an%28//7 p.f=0 p.vx=p.sp
 else p.an=0 p.vx=0 end
 --change weapon
 if btnp(7) and bw.am>0 then
 	if p.wp==1 then p.wp=2
  else p.wp=1 end
 end
 --collision
 u=p.y+p.vy+1 d=p.y+p.vy+8 l=p.x+p.vx r=p.x+p.vx+7
 if solid(l,u) or solid(l,d-1) or solid(r,u) or solid(r,d-1) then p.vx=0 end
 --gravity
 if solid(l+1,d) or solid(r-1,d) or p.pl then p.vy=0
 else p.vy=p.vy+0.2 end
 --jump
 if p.vy==0 and btnp(4) then p.vy=-3 end
 if shroom(l,d) or shroom(r,d) then p.vy=-4 end
 --collision up
 if p.vy<0 and (solid(l+2,u) or solid(r-2,u)) then p.vy=0 end
 --update movement
 p.x=p.x+p.vx
 p.y=p.y+p.vy
 --limit health
 if p.hl<0 then p.hl=0 end
 if p.hl>3 then p.hl=3 end
 --heal
 if healArea(l+4,u+4) then
 	if not isHeal then effUp(5)p.hl=3 isHeal=true end
 else isHeal=false end
 --invisible
 if p.inv then
  t.inv=t.inv+1
  --blink
  if time()%200>100 then
  	if p.wp==1 then sword(l,u,p.f)
   elseif p.wp==2 then bow(l,u,p.f) end
  	spr(208+p.an,p.x+c.x,p.y+c.y,0,1,p.f)
  end
  if t.inv==60*2 then t.inv=0 p.inv=false end
 --draw
 else
 	if p.wp==1 then sword(l,u,p.f)
  elseif p.wp==2 then bow(l,u,p.f) end
 	spr(208+p.an,p.x+c.x,p.y+c.y,0,1,p.f)
 end
 --effect
	--if p.eup and #eup==0 then effUp() end
end

--misc
function effUp(mc)
 local e={x=0,y=0,c=mc,r=16}
 eup[#eup+1]=e
end
function drawEffUp()
 for i,e in pairs(eup) do
  e.x=p.x+4 e.y=p.y+4
  e.r=e.r-1
  circb(e.x+c.x,e.y+c.y,e.r,e.c)
  if e.r<0 then p.eup=false table.remove(eup,i) end
 end
end
